INSERT INTO `products` (`id`, `name`, `slug`, `short_desc`, `desc`, `regular_price`, `sale_price`, `SKU`, `stock_status`, `featured`, `quantity`, `sold`, `image`, `images`, `category_id`, `created_at`, `updated_at`, `subcategory_id`, `brand_id`) VALUES
(47, 'CPU AMD Ryzen 5 5600X', 'cpu-amd-ryzen-5-5600x', 'CPU AMD Ryzen 5 5600X, with Wraith Stealth cooler / 3.7 GHz (4.6GHz Max Boost) / 35MB Cache / 6 cores, 12 threads / 65W / Socket AM4', '<h2>CPU AMD Ryzen 5 5600X, with Wraith Stealth cooler / 3.7 GHz (4.6GHz Max Boost) / 35MB Cache / 6 cores, 12 threads / 65W / Socket AM4<br>&nbsp;</h2><p>Bạn đang cần một&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html\"><strong>bộ vi xử lý</strong></a>&nbsp;mạnh mẽ để giải quyết các công việc đồ họa cao cấp, hay chơi những tựa game đỉnh cao, thì sản phẩm&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?brand=10\"><strong>CPU AMD Ryzen</strong></a><strong>&nbsp;5 5600X</strong>&nbsp;chắc chắn sẽ đáp ứng hoàn hảo các yêu cầu của bạn.<br>&nbsp;</p><p><img src=\"https://phucanhcdn.com/media/product/41127_ryzen_7_5800x_ha1.jpg\" alt=\"\"></p><p><strong>CPU AMD Ryzen 5 5600X</strong>&nbsp;là sản phẩm vi xử lý mới và mạnh mẽ của&nbsp;<strong>AMD</strong>&nbsp;nằm trong&nbsp;<strong>Series Ryzen 5000</strong>.&nbsp;</p><p><strong>Hiệu suất nhanh mạnh</strong></p><p><strong>Bộ xử lý AMD&nbsp;Ryzen 5 5600X</strong>&nbsp;là thế hệ tân tiến, mang đến sức mạnh lớn để có thể vận hành mượt mà các tựa game nặng. Được trang bi những tính năng tốt nhất để nâng cao sức mạnh xử lý của máy tính như&nbsp;Precision Boost 2, Precision Boost Overdrive&nbsp;4&nbsp;và PCIe® 4.0..&nbsp;</p><p><strong>AMD&nbsp;Ryzen 5 5600X</strong>&nbsp;sở hữu kiến trúc Zen 3 với nhiều thay đổi mang lại hiệu năng rất cao so với thế hệ cũ. Được sản xuất trên nền tảng socket AM4 dựa trên&nbsp;tiến trình&nbsp;sản xuất 7nm. Sở hữu thông số ấn tượng, 6 nhân, 12 luồng xử lý, bộ nhớ đệm lên tới 32MB, chạy tần số cơ bản là 3,7 GHz và tần số turbo là 4,6 GHz.&nbsp;</p><p>Xung boost cao hơn</p><p>IPC tăng lên tới 19%</p><p>Giảm thiểu đáng kể độ trễ bộ nhớ</p><p>Tăng tốc giao tiếp giữa nhân và cache</p><p>Sản phẩm được tích hợp đồ họa AMD Radeon, với những nhà thiết kế đồ họa, sẽ tiết kiệm thời gian đáng kể của công việc, dù là các mô hình 3D, các kiến trúc xây dựng, mô hình nhân vật.</p><p><img src=\"https://phucanhcdn.com/media/lib/41127_AMD7.jpg\" alt=\"\"></p><p>Đi kèm sản phẩm là một bộ tản nhiệt làm mát CPU chính hãng.&nbsp;</p><p>Sản phẩm hiện đang có bán tại&nbsp;<strong>Phúc Anh</strong>&nbsp;với chế độ bảo hành chính hãng 36 tháng.</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td><a href=\"https://www.anphatpc.com.vn/cpu-desktop_dm1025.html\">Bộ vi xử lý CPU</a></td></tr><tr><td>Hãng sản xuất</td><td>AMD</td></tr><tr><td>Model</td><td>Ryzen 5 5600X</td></tr><tr><td>Socket</td><td>AM4</td></tr><tr><td>Tốc độ cơ bản</td><td>3.7GHz</td></tr><tr><td>Cache</td><td><p>L2 Cache:&nbsp;3MB</p><p>L3 Cache: 32MB</p></td></tr><tr><td>Nhân CPU</td><td>6&nbsp;Nhân</td></tr><tr><td>Luồng CPU</td><td>12&nbsp;Luồng</td></tr><tr><td>VXL đồ họa</td><td>AMD Radeon</td></tr><tr><td>Bộ nhớ hỗ trợ</td><td>DDR4&nbsp;3200MHz</td></tr><tr><td>Dây chuyền công nghệ</td><td>7nm&nbsp;</td></tr><tr><td>Điện áp tiêu thụ tối đa</td><td>105W</td></tr></tbody></table></figure>', 7200000, 7100000, 'Ryzen-500x', 'Trong Kho', 0, 9, 1, '1635654926.jpg', ',16356549260.jpg,16356549261.jpg', 8, '2021-10-30 21:35:26', '2021-11-02 22:35:05', 4, NULL),
(48, 'CPU AMD Ryzen 5 3400G', 'cpu-amd-ryzen-5-3400g', 'CPU AMD Ryzen 5 3400G (Up to 4.2Ghz/ 6Mb cache)', '<h2>CPU AMD Ryzen 5 3400G<br>&nbsp;</h2><h3>Hiệu năng xử lí đa nguồn</h3><p><strong>CPU AMD Ryzen 5 3400G</strong>&nbsp;gồm 4 lõi, 8 luồng tiết kiệm điện nhất, cùng với những công nghệ thông minh nhất.<br>&nbsp;</p><p>Mỗi vi xử lý thuộc dòng AMD Ryzen đều được giải phóng để đạt sức mạnh tối đa từ trong nhà máy, và bạn có thể hoàn toàn cá nhân hóa hiệu suất&nbsp;<strong>CPU AMD Ryzen 5 3400G</strong>&nbsp;theo ý của bạn. AMD cung cấp tiện ích AMD Ryzen Master để dễ dàng tùy chỉnh lợi thế này.</p><p><img src=\"https://phucanhcdn.com/media/lib/35770_MainAsusROGSTRIXB365-FGAMINGh1.jpg\" alt=\"Main Asus ROG STRIX B365-F GAMING h1\"></p><h3>Cá nhân hóa hiệu năng CPU của bạn</h3><p>AMD Ryzen Master cung cấp cho bạn 4 bảng tùy chỉnh để lưu trữ những thiết lập về xung nhịp và điện áp của cả&nbsp;<strong>AMD Ryzen 5 3400G</strong>&nbsp;và DDR4. Bạn cũng có thể chọn lõi và căn thời gian bộ nhớ.</p><h3>Giám sát hệ thống</h3><p>AMD Ryzen Master thể hiện hết cho bạn những thông số chính xác của phần cứng, cho phép bạn quản lý hệ thống thời gian thực và theo dõi xung nhịp, nhiệt độ của từng lõi.</p><h3>Công nghệ AMD SENSEMI</h3><p>AMD xin giới thiệu công nghệ AMD SenseMI, bao gồm các tính năng tự học và tự thích nghi giúp vi xử lý&nbsp;<strong>AMD Ryzen 5 3400G</strong>&nbsp;điều chỉnh hiệu năng phù hợp với bạn và với ứng dụng. Kết quả cho ra đời một công nghệ tự tư duy.</p><p>Tới&nbsp;<a href=\"https://www.phucanh.vn/\"><strong>Phúc Anh</strong></a>&nbsp;để được tư vấn và sở hữu các sản phẩm công nghệ,&nbsp;<a href=\"https://www.phucanh.vn/may-tinh-xach-tay-laptop.html\"><strong>laptop</strong></a>,&nbsp;<a href=\"https://www.phucanh.vn/may-tinh-de-ban-may-chu.html\"><strong>PC</strong></a>,<strong>&nbsp;</strong><a href=\"https://www.phucanh.vn/linh-kien-pc-thiet-bi-ngoai-vi.html\"><strong>phụ kiện, linh kiện máy tính</strong></a><strong>,</strong>... chính hãng, uy tín cùng chất lượng dịch vụ tốt nhất hiện nay.</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td>Bộ vi xử lý (CPU)</td></tr><tr><td>Hãng sản xuất</td><td>AMD</td></tr><tr><td>Mã CPU</td><td>3400G</td></tr><tr><td>Dòng CPU</td><td>Ryzen 5</td></tr><tr><td>Socket</td><td>AM4</td></tr><tr><td>Tốc độ</td><td>3.7Ghz</td></tr><tr><td>Tốc độ Tubor tối đa</td><td>Up to 4.2Ghz</td></tr><tr><td>Cache</td><td>6Mb</td></tr><tr><td>Nhân CPU</td><td>4 Core</td></tr><tr><td>Luồng CPU</td><td>8 Threads</td></tr><tr><td>VXL đồ họa</td><td>Radeon RX Vega 11</td></tr><tr><td>Dây chuyền công nghệ</td><td>12nm FinFET</td></tr><tr><td>Điện áp tiêu thụ tối đa</td><td>65W</td></tr><tr><td>Tính năng khác</td><td>Thermal Solution: Wraith Spire.</td></tr><tr><td>Kiểu đóng gói</td><td>Box</td></tr></tbody></table></figure>', 4500000, 4300000, 'Ryzen5-3400G', 'Trong Kho', 0, 20, NULL, '1635655197.png', ',16356551970.png,16356551971.jpg', 8, '2021-10-30 21:39:57', '2021-10-30 21:39:57', 4, NULL),
(49, 'CPU AMD Ryzen 7 5800X', 'cpu-amd-ryzen-7-5800x', 'CPU AMD Ryzen 7 5800X / 3.8 GHz (4.7GHz Max Boost) / 36MB Cache / 8 cores, 16 threads / 105W / Socket AM4', '<p>CPU AMD Ryzen 7 5800X / 3.8 GHz (4.7GHz Max Boost) / 36MB Cache / 8 cores, 16 threads / 105W / Socket AM4<br>&nbsp;</p><p>Bạn đang cần một&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html\"><strong>bộ vi xử lý</strong></a>&nbsp;mạnh mẽ để giải quyết các công việc đồ họa cao cấp, hay chơi những tựa game đỉnh cao, thì sản phẩm&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?brand=10\"><strong>CPU AMD Ryzen</strong></a><strong>&nbsp;7 5800X</strong>&nbsp;chắc chắn sẽ đáp ứng hoàn hảo các yêu cầu của bạn.<br>&nbsp;</p><p><img src=\"https://phucanhcdn.com/media/product/41127_ryzen_7_5800x_ha1.jpg\" alt=\"\"></p><p><strong>CPU AMD Ryzen 7 5800X</strong>&nbsp;là sản phẩm vi xử lý mới và mạnh mẽ của&nbsp;<strong>AMD</strong>&nbsp;nằm trong&nbsp;<strong>Series Ryzen 5000</strong>.&nbsp;</p><p><strong>Hiệu suất nhanh mạnh</strong></p><p><strong>Bộ xử lý AMD&nbsp;Ryzen 7 5800X</strong>&nbsp;là thế hệ tân tiến, mang đến sức mạnh lớn để có thể vận hành mượt mà các tựa game nặng. Được trang bi những tính năng tốt nhất để nâng cao sức mạnh xử lý của máy tính như&nbsp;Precision Boost 2, Precision Boost Overdrive&nbsp;4&nbsp;và PCIe® 4.0..&nbsp;</p><p><strong>AMD&nbsp;Ryzen 7 5800X</strong>&nbsp;sở hữu kiến trúc Zen 3 với nhiều thay đổi mang lại hiệu năng rất cao so với thế hệ cũ. Mỗi CCX giờ đây sẽ có 8 nhân/CCX, thay vì 4 nhân/CCX như Zen 2. Các CCX có thể chạy trên chế độ Single Thread hoặc Two Thread SMT, cho tối đa 16 luồng/CCX. Từ đó sẽ cho ra tối đa 16 nhân/32 luồng. Mỗi CCD giờ đây sẽ chỉ chứa 1 CCX, thay vì 2 như thế hệ tiền nhiệm.&nbsp;Mỗi nhân Zen 3 trên Ryzen 5000 sẽ có 512kB Cache L2. Từ đó có 4MB cache L2/CCD và nếu CPU có 2 CCD thì tổng lượng cache L2 sẽ là 8MB. Đi cùng với đó, mỗi CCD sẽ có thêm 32MB cache L3 và sẽ hợp nhất lại thành 1, thay vì chia làm đôi như thế hệ trước.&nbsp;</p><p>Xung boost cao hơn</p><p>IPC tăng lên tới 19%</p><p>Giảm thiểu đáng kể độ trễ bộ nhớ</p><p>Tăng tốc giao tiếp giữa nhân và cache</p><p>Với những nhà thiết kế đồ họa, sẽ tiết kiệm thời gian đáng kể của công việc, dù là các mô hình 3D, các kiến trúc xây dựng, mô hình nhân vật.</p><p><img src=\"https://phucanhcdn.com/media/lib/41127_AMD7.jpg\" alt=\"\"></p><p>Sản phẩm hiện đang có bán tại&nbsp;<strong>Phúc Anh</strong>&nbsp;với chế độ bảo hành chính hãng 36 tháng.</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td><a href=\"https://www.anphatpc.com.vn/cpu-desktop_dm1025.html\">Bộ vi xử lý CPU</a></td></tr><tr><td>Hãng sản xuất</td><td>AMD</td></tr><tr><td>Model</td><td>Ryzen 7 5800X</td></tr><tr><td>Socket</td><td>AM4</td></tr><tr><td>Tốc độ cơ bản</td><td>3.8GHz</td></tr><tr><td>Cache</td><td><p>L2 Cache:&nbsp;4MB</p><p>L3 Cache: 32MB</p></td></tr><tr><td>Nhân CPU</td><td>8&nbsp;Nhân</td></tr><tr><td>Luồng CPU</td><td>16 Luồng</td></tr><tr><td>VXL đồ họa</td><td>AMD Radeon</td></tr><tr><td>Bộ nhớ hỗ trợ</td><td>DDR4&nbsp;3200MHz</td></tr><tr><td>Dây chuyền công nghệ</td><td>7nm&nbsp;</td></tr><tr><td>Điện áp tiêu thụ tối đa</td><td>105W</td></tr></tbody></table></figure><p>&nbsp;</p>', 11700000, 11630000, 'Ryzen7-5800X', 'Trong Kho', 0, 9, NULL, '1635655359.jpg', ',16356553590.jpg', 8, '2021-10-30 21:42:39', '2021-10-30 21:44:25', 4, NULL),
(50, 'CPU Intel Core i3-10100F', 'cpu-intel-core-i3-10100f', 'CPU Intel Core i3-10100F (3.6GHz turbo up to 4.3Ghz, 4 nhân 8 luồng, 6MB Cache, 65W) - Socket Intel LGA 1200', '<h2>CPU Intel Core i3-10100F<br>&nbsp;</h2><p><strong>Intel Core i3-10100</strong>, CPU Comet Lake dành cho phân khúc thấp nay đã có được tính năng siêu phân luồng.&nbsp;<strong>Core i3-10100F</strong>&nbsp;sẽ là một phần của dòng sản phẩm thế hệ 10 Comet Lake-S của Intel dành cho thị trường máy tính tầm thấp nổi bật với cấu hình 4 nhân 8 luồng.&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html\">Bộ vi xử lí</a>&nbsp;này có xung nhịp 3.60GHz, tuy nhiên đây có thể chưa phải là tốc độ xung nhịp cuối cùng.<br>&nbsp;</p><p><img src=\"https://phucanhcdn.com/media/lib/39090_CPUIntelCorei3-10100h5.jpg\" alt=\"CPU Intel Core i3-10100\"></p><p><strong>Core i3-10100F</strong>&nbsp;có 6MB bộ nhớ đệm&nbsp;Intel® Smart Cache. Đây thực sự là một sản phẩm vô cùng đáng giá trong phân khúc tầm thấp ở thế hệ 10 của&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?brand=90\">Intel</a>, vì đa số các game trong năm 2020 đều đã sử dụng trên 4 nhân xử lý.</p><p><img src=\"https://phucanhcdn.com/media/product/39090_cpu_intel_core_i3_10100_ha3.jpg\" alt=\"CPU Intel Core i3-10100\"></p><p>Mức xung boost rất cao trong tầm giá, lên tận 4.3Ghz đã được Intel công bố và xác nhận. Sản phẩm&nbsp;<strong>i3-10100F</strong>&nbsp;đã có siêu phân luồng, xung boost đơn nhân cao đã dễ dàng đánh bật tất cả những sản phẩm đời 9 là 9100, 9100F và 9350K.</p><p><img src=\"https://phucanhcdn.com/media/product/39090_cpu_intel_core_i3_10100_ha2.jpg\" alt=\"CPU Intel Core i3-10100\"></p><p><a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?filter=%2C24084%2C\">CPU Intel Core i3</a>-10100F với 4 nhân 8 luồng giúp bạn hoàn toàn có thể ráp cho mình một bộ máy với đủ mức nhu cầu giải trí.</p><h2>THÔNG SỐ KỸ THUẬT</h2><h2>Essentials</h2><ul><li>Product Collection<a href=\"https://ark.intel.com/content/www/us/en/ark/products/series/195733