ology (VT-x)&nbsp;‡Yes</li><li>Intel® Virtualization Technology for Directed I/O (VT-d)&nbsp;‡Yes</li><li>Intel® VT-x with Extended Page Tables (EPT)&nbsp;‡Yes</li><li>Intel® Transactional Synchronization ExtensionsNo</li><li>Intel® 64&nbsp;‡Yes</li><li>Instruction Set64-bit</li><li>Instruction Set ExtensionsIntel® SSE4.1, Intel® SSE4.2, Intel® AVX2</li><li>Idle StatesYes</li><li>Enhanced Intel SpeedStep® TechnologyYes</li><li>Thermal Monitoring TechnologiesYes</li><li>Intel® Identity Protection Technology&nbsp;‡Yes</li><li>Intel® Stable Image Platform Program (SIPP)No</li></ul><h2>Security &amp; Reliability</h2><ul><li>Intel® AES New InstructionsYes</li><li>Secure KeyYes</li><li>Intel® Software Guard Extensions (Intel® SGX)Yes with Intel® ME</li><li>Intel® OS GuardYes</li><li>Intel® Trusted Execution Technology&nbsp;‡No</li><li>Execute Disable Bit&nbsp;‡Yes</li><li>Intel® Boot GuardYes</li></ul><p>&nbsp;</p>', 3200000, 0, 'CoreI3-10100F', 'Trong Kho', 0, 10, NULL, '1635655637.jpg', ',16356556370.jpg,16356556371.jpg', 8, '2021-10-30 21:47:17', '2021-10-30 21:47:17', 4, NULL),
(51, 'CPU Intel Pentium Gold G6405', 'cpu-intel-pentium-gold-g6405', 'CPU Intel Pentium Gold G6405 (4.1GHz, 2 nhân 4 luồng, 4MB Cache, 58W) – SK LGA 1200', '<h3>CPU Intel Pentium Gold G6405 (4.1GHz, 2 nhân 4 luồng, 4MB Cache, 58W) – SK LGA 1200<br>&nbsp;</h3><p><a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html\"><strong>Bộ vi xử lý</strong></a>&nbsp;-&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html\"><strong>CPU</strong></a>&nbsp; luôn luôn là&nbsp; thành phần không thể thiếu trong các máy tính.&nbsp;<strong>CPU Intel Pentium G6405</strong>&nbsp;là sản phẩm<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?brand=90\"><strong>&nbsp;bộ vi xử lý Intel</strong></a>&nbsp;phù hợp cho hệ thống máy tính phục vụ công việc họp tập cơ bản tại cái trường học, hay công việc kế toán, quản lý sổ sách cho các doanh nghiệp, đồng thời cũng đáp ứng tốt các nhu cầu đọc báo, xem phim, nghe nhạc của người dùng.&nbsp;<br>&nbsp;</p><p><img src=\"/ckfinder/userfiles/images/41475_hnc_intel_pentium_gold_right_face_850x850.jpg\" alt=\"\"></p><p><strong>CPU Intel Pentium Gold G6405</strong>&nbsp;là&nbsp;<strong>bộ vi xử lý</strong>&nbsp;dành cho&nbsp;máy tính để bàn với&nbsp;2 nhân 4 luồng tần số xung nhịp 4.1GHz, sử dụng kiến ​​trúc Comet Lake vẫn sử dụng socket LGA 1200 và có thể chạy được trên các bo mạch chủ H410, B460, H470, Z490&nbsp; và các bo mạch chủ thế hệ mới H510, B560, Z590.</p><p>Tốc độ bộ nhớ được hỗ trợ chính thức của&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?brand=90\"><strong>CPU Intel</strong></a><strong>&nbsp;Pentium Gold G6405</strong>&nbsp;cao nhất là 2666 MHz. Hỗ trợ bộ nhớ RAM&nbsp;DDR4 2666 MHz.&nbsp;</p><p>Hỗ trợ&nbsp;bộ nhớ DDR4.&nbsp;<strong>Bộ vi xử lý Intel</strong>&nbsp;này được tích hợp sẵn bộ xử lí đồ họa Intel® UHD Graphics 610, tiết kiệm chi phí khi không cần trang bị&nbsp;<a href=\"https://www.phucanh.vn/card-man-hinh.html\"><strong>card đồ họa</strong></a>&nbsp;rời khi không cần thiết.</p><p><strong>CPU Intel Pentium Gold G6405</strong>&nbsp;với 2 nhân và 4 luồng xử lý cùng mức giá dễ tiếp cận sẽ phù hợp cho các cấu hình máy bộ văn phòng, học sinh - sinh viên vừa làm việc, học tập và giải trí nhẹ nhàng.</p><p>Sản phẩm hiện đang có bán tại&nbsp;<strong>Phúc Anh&nbsp;</strong>với chế độ bảo hành 36 tháng chính hãng.&nbsp;</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Thương hiệu</td><td>Intel</td></tr><tr><td>Loại CPU</td><td>Dành cho máy bàn</td></tr><tr><td>Socket</td><td>LGA 1200</td></tr><tr><td>Số nhân</td><td>2</td></tr><tr><td>Số luồng</td><td>4</td></tr><tr><td>Tốc độ xung nhịp</td><td>4,1 GHz</td></tr><tr><td>Cache</td><td>4MB</td></tr><tr><td>Tiến trình sản xuất</td><td>14nm</td></tr><tr><td>Hỗ trợ bộ nhớ</td><td>DDR4</td></tr><tr><td>Hỗ trợ số kênh bộ nhớ</td><td>2</td></tr><tr><td>Phiên bản PCI Express</td><td>3</td></tr><tr><td>TDP</td><td>58W</td></tr></tbody></table></figure><p>&nbsp;</p>', 2700000, 0, 'Intel-Pentium-G6405', 'Trong Kho', 0, 20, NULL, '1635655880.jpg', ',16356558800.png', 8, '2021-10-30 21:51:20', '2021-10-30 21:51:20', 4, NULL),
(52, 'CPU Intel Core i5-10400F', 'cpu-intel-core-i5-10400f', 'CPU Intel Core i5-10400F (2.9GHz turbo up to 4.3GHz, 6 nhân 12 luồng, 12MB Cache, 65W) - Socket Intel LGA 1200', '<h2>CPU Intel Core i5-10400F<br>&nbsp;</h2><p><a href=\"https://www.phucanh.vn/tim?q=Core+i5-10400F\"><strong>Core i5-10400F</strong></a>&nbsp;là&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html\">bộ vi xử lí</a>&nbsp;nằm trong chuỗi CPU Comet Lake thế hệ 10 của Intel được sản xuất trên tiến trình 14nm.</p><p><img src=\"https://phucanhcdn.com/media/product/39092_cpu_core_i5__the_he_10_ha2.jpg\" alt=\"CPU Intel Core i5-10400F\"><br>&nbsp;</p><p><strong>Intel Core i5-10400F</strong>&nbsp;hướng đến đối tượng khách hàng thuộc phân khúc tầm trung và chuyên dùng&nbsp;<a href=\"https://www.phucanh.vn/may-tinh-gaming-lap-rap.html\">máy tính để chơi game</a>.&nbsp;<strong>Core i5 10400F</strong>&nbsp;mang hậu tố F vậy nên không được tích hợp sẵn nhân đồ họa trên CPU. Nó được trang bị 6 nhân 12 luồng, bộ nhớ đệm cache L3 12MB. Cùng với tốc độ xử lý xung nhịp cơ bản 2.90 GHz, turbo boost tối đa lên tới 4.30 GHz. Những thông số này nói lên sự mạnh mẽ trong xử lý của 10400F.</p><p><img src=\"https://phucanhcdn.com/media/lib/39092_CPUIntelCorei5-10400Fh5.jpg\" alt=\"CPU Intel Core i5-10400F\"></p><p>Bộ xử lý sáu nhân&nbsp;<strong>i5-10400F</strong>&nbsp;của&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?brand=90\">Intel</a>&nbsp;đi kèm với các tính năng như hỗ trợ bộ nhớ Intel Optane, Intel Boot Guard, công nghệ ảo hóa Intel VT-D cho I/O trực tiếp. Ngoài ra, bộ xử lý này có bộ nhớ cache 12 MB và 16 làn PCIe 3.0.</p><p>Dễ tính nhất trong số các CPU hiệu suất cao lần này của Intel,&nbsp;<a href=\"https://www.phucanh.vn/bo-vi-xu-ly.html?filter=%2C24081%2C\">Core i5</a><strong>-10400F</strong>&nbsp;có thể chạy tốt trên các bo mạch chủ B460 giá rẻ và chỉ cần tản nhiệt đi kèm từ hãng là có thể bon bon về đích.</p><p><img src=\"https://phucanhcdn.com/media/product/39092_cpu_core_i5__the_he_10_ha3.jpg\" alt=\"CPU Intel Core i5-10400F\"></p><p>So về hiệu năng chơi game thì&nbsp;<strong>i5-10400F</strong>&nbsp;có cùng sức mạnh với i7-9700F. Điều này khá dễ hiểu khi đa số các trò chơi thường không phụ thuộc vào hiệu năng đa lõi mà là sức mạnh của đơn lõi.</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td>Bộ vi xử lý (CPU)</td></tr><tr><td>Hãng sản xuất</td><td>Intel</td></tr><tr><td>Mã CPU</td><td>10400F</td></tr><tr><td>Dòng CPU</td><td>Core i5 CometlakeLake</td></tr><tr><td>Socket</td><td>LGA1200</td></tr><tr><td>Tốc độ</td><td>2.9Ghz</td></tr><tr><td>Tốc độ Tubor tối đa</td><td>Up to 4.3Ghz</td></tr><tr><td>Cache</td><td>12Mb</td></tr><tr><td>Nhân CPU</td><td>6 Core</td></tr><tr><td>Luồng CPU</td><td>12 Threads</td></tr><tr><td>VXL đồ họa</td><td>None</td></tr><tr><td>Dây chuyền công nghệ</td><td>14nm</td></tr><tr><td>Điện áp tiêu thụ tối đa</td><td>65W</td></tr><tr><td>Tính năng khác</td><td>Đang cập nhật</td></tr><tr><td>Kiểu đóng gói</td><td>Box</td></tr></tbody></table></figure><p>&nbsp;</p>', 4500000, 0, 'CoreI5-10400F', 'Trong Kho', 0, 20, NULL, '1635660145.jpg', ',16356601450.jpg,16356601451.jpg', 8, '2021-10-30 23:02:25', '2021-10-31 02:26:05', 4, 1),
(53, 'Màn hình Asus VL249HE', 'man-hinh-asus-vl249he', 'Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)\n', '<h2>Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)<br>&nbsp;</h2><p>-&nbsp;<a href=\"https://www.phucanh.vn/man-hinh-may-tinh.html?filter=%2C27709%2C\">Màn hình 23.8 inch</a>&nbsp;<a href=\"https://www.phucanh.vn/thuong-hieu-man-hinh.html?filter=%2C26501%2C\">Full HD</a>&nbsp;với công nghệ IPS cho góc xem rộng lên tới 178°</p><p>- Với tốc độ làm mới lên tới 75Hz cùng công nghệ Adaptive-Sync/FreeSync™ để loại bỏ hiện tượng xé hình và gián đoạn tốc độ khung hình, giúp chơi game nhanh và mượt hơn</p><p>- Công nghệ GamePlus độc quyền của Asus với tâm ngắm, bộ hẹn giờ, bộ đếm FPS, chức năng căn chỉnh màn hình</p><p>- Chứng nhận của TÜV Rheinland cho công nghệ Flicker-free (Chống nhấp nháy) và Low Blue Light (Ánh sáng xanh dương thấp) để đảm bảo trải nghiệm xem thoải mái</p><p>- Thiết kế mỏng và không viền với thiết kế gắn tường chuẩn VESA để tiết kiệm khoảng trống bàn làm việc<br>&nbsp;</p><p><img src=\"https://phucanhcdn.com/media/product/37997_vl249he_ha1ss.jpg\" alt=\"\"></p><h3>Thiết kế mỏng, không viền, tao nhã</h3><p><strong>Màn hình&nbsp;VL249HE</strong>&nbsp;có kích thước&nbsp;23,8 inch với thiết kế mỏng và không viền là sự bổ sung lý tưởng cho nhu cầu sử dụng tại gia đình hoặc văn phòng làm việc. Công nghệ IPS với góc xem cực rộng lên tới 178°, tốc độ làm mới lên tới 75Hz và công nghệ Adaptive-Sync/FreeSync™ loại bỏ hiện tượng xé hình và gián đoạn tốc độ khung hình, giúp chơi game mượt mà và liền mạch hơn. Ngoài ra, công nghệ bảo vệ mắt của Asus đảm bảo mang lại trải nghiệm xem thoải mái. Phù hợp với bộ giá gắn tường chuẩn VESA (100 x 100 mm) để tiết kiệm không gian bàn làm việc.</p><p><img src=\"https://phucanhcdn.com/media/lib/37997_ManhinhAsusVL249HE23.8Inch75HzIPSVinmng-1.png\" alt=\"Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)\"></p><h3>Hoàn hảo cho thiết lập đa màn hình</h3><p><a href=\"https://www.phucanh.vn/man-hinh-may-tinh.html?filter=%2C27151%2C\"><strong>Màn hình văn phòng</strong></a><strong>&nbsp;Asus VL249</strong>&nbsp;giúp tiết kiệm không gian nhờ kiểu dáng mỏng, thiết kế không viền khiến nó trở nên lý tưởng cho các cấu hình đa màn hình gần như liền mảnh để bạn có thể trải nghiệm xem đắm chìm hơn. Bất kể là bạn đang chơi game, xem phim hoặc làm việc gì đó, bạn có thể xem toàn cảnh và có được cảm giác đắm chìm hơn.</p><p><img src=\"https://phucanhcdn.com/media/lib/37997_ManhinhAsusVL249HE23.8Inch75HzIPSVinmng-8.jpg\" alt=\"Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)\"></p><h3>Trải nghiệm xem</h3><p>Tầm nhìn rộng nhờ trang bị tấm nền IPS giúp góc xem rộng lên tới 178°, giảm thiểu sự thay đổi sắc màu, cho màu sắc đồng đều và chính xác tại bất kỳ góc xem nào để mang lại trải nghiệm xem tốt hơn.</p><p><img src=\"https://phucanhcdn.com/media/lib/37997_ManhinhAsusVL249HE23.8Inch75HzIPSVinmng-7.jpg\" alt=\"Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)\"></p><h3>Tốc độ làm mới 75Hz với công nghệ Asus GamePlus</h3><p>Nhờ hỗ trợ công nghệ Adaptive Sync/FreeSync™ với tốc độ làm mới lên tới&nbsp;<a href=\"https://www.phucanh.vn/man-hinh-may-tinh.html?filter=%2C26717%2C\">75Hz</a>, giảm độ trễ hoặc hiện tượng nhòe chuyển động gây khó chịu, VL249 giúp bạn phản ứng tức thì với những gì đang diễn ra trên&nbsp;<a href=\"https://www.phucanh.vn/man-hinh-may-tinh.html\">màn hình</a>&nbsp;và trải nghiệm chơi game siêu mượt, để bạn sẽ là người hành động trước tiên.</p><p><img src=\"https://phucanhcdn.com/media/lib/37997_ManhinhAsusVL249HE23.8Inch75HzIPSVinmng-4.jpg\" alt=\"Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)\"></p><p>Ngoài ra, công nghệ GamePlus độc quyền của Asus với các tính năng Crosshair (Tâm ngắm), Timer (Bộ đếm thời gian), FPS counter (Bộ đếm số khung hình/ giây) và Display Alignment (Hiển thị căn chỉnh) mang lại cho bạn những cải tiến trong game giúp bạn tận hưởng game của mình được tối đa. Tất cả các chức năng có thể dễ dàng truy cập được thông qua menu hiển thị trên&nbsp;<a href=\"https://www.phucanh.vn/man-hinh-asus.html\">màn hình Asus</a>. Chức năng này được phát triển theo tư vấn từ các game thủ chuyên nghiệp, cho phép họ luyện tập và nâng cao kỹ năng chơi game.</p><h3>Bảo vệ mắt bạn với công nghệ Asus Eye Care</h3><p>Công nghệ Bộ lọc ánh sáng xanh của Asus được TÜV Rheinland chứng nhận chắc chắn sẽ bảo vệ bạn khỏi các ánh sáng xanh có hại, đồng thời bạn có thể dễ dàng truy cập bốn cấu hình bộ lọc khác nhau bằng cách sử dụng phím nóng.&nbsp;<strong>Màn hình Asus VL249</strong>&nbsp;đã vượt qua những cuộc thử nghiệm hiệu năng nghiêm ngặt và được chứng nhận là không bị nhấp nháy nháy và phát ra mức ánh sáng màu xanh thấp bởi các phòng thí nghiệm của TÜV Rheinland - nhà cung cấp dịch vụ kỹ thuật, an toàn và chứng nhận toàn cầu.</p><p><img src=\"https://phucanhcdn.com/media/lib/37997_ManhinhAsusVL249HE23.8Inch75HzIPSVinmng-5.png\" alt=\"Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)\"></p><h3>Công nghệ không chập chờn</h3><p><img src=\"https://phucanhcdn.com/media/lib/37997_ManhinhAsusVL249HE23.8Inch75HzIPSVinmng-9.jpg\" alt=\"Màn hình Asus VL249HE 23.8Inch 75Hz IPS (Viền mỏng)\"></p><p>Đã đến lúc chào tạm biệt đôi mắt mệt mỏi và căng thẳng.&nbsp;<a href=\"https://www.phucanh.vn/man-hinh-may-tinh.html?filter=%2C27151%2C&amp;brand=1\">Màn hình văn phòng Asus</a>&nbsp;được trang bị công nghệ Flicker-free (chống nhấp nháy) của Asus và đã được TÜV Rheinland chứng nhận. Công nghệ này được thiết kế để giảm bớt hiện tượng nhấp nháy nháy của màn hình nhằm mang lại trải nghiệm xem thoải mái. Công nghệ này giúp giảm thiểu các trường hợp mỏi mắt và các căn bệnh nguy hiểm khác, đặc biệt là khi bạn dành quá nhiều thời gian sử dụng màn hình để xem các video ưa thích.</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td>Màn hình</td></tr><tr><td>Tên Hãng</td><td>Asus</td></tr><tr><td>Model</td><td>VL249HE 75Hz</td></tr><tr><td>Kiểu màn hình</td><td>Màn hình văn phòng</td></tr><tr><td>Kích thước màn hình</td><td>23.8Inch IPS</td></tr><tr><td>Độ sáng</td><td>250cd/m2</td></tr><tr><td>Tỷ lệ tương phản</td><td>80.000.000:1</td></tr><tr><td>Độ phân giải</td><td>Full HD (1920x1080)</td></tr><tr><td>Thời gian đáp ứng</td><td>5ms</td></tr><tr><td>Góc nhìn</td><td>178/178, chống lóa</td></tr><tr><td>Cổng giao tiếp</td><td><p>HDMI, D-Sub</p><p>Phụ kiện đi kèm:&nbsp;1 x Dây nguồn 2 chấu dẹp, 1 x HDMI cable, 1 x Đế + Chân đế, Quick start guide, Warranty Card</p></td></tr><tr><td>Tính năng khác</td><td>&nbsp;Màn hình bảo vệ mắt VL249HE - 23,8 inch, IPS, 75Hz, Adaptive-Sync/FreeSync™, Không viền, Mỏng, Low Blue Light (Bộ lọc ánh sáng xanh dương), Flicker Free (Khử nhấp nháy), Treo tường</td></tr><tr><td>Xuất xứ</td><td>Chính hãng</td></tr></tbody></table></figure><p>&nbsp;</p>', 3200000, 3150000, 'VL249HE', 'Trong Kho', 0, 49, NULL, '1635660214.jpg', ',16356602140.jpg,16356602141.jpg', 9, '2021-10-30 23:03:34', '2021-10-30 23:03:34', NULL, NULL),
(54, ' Camera Ezviz C6N', 'camera-ezviz-c6n', 'Phù hợp lắp đặt TRONG NHÀ\nBản quốc tế xem từ xa không bị giới hạn\nGiám sát từ xa qua điện thoại.\nHình ảnh sắc nét full HD - 1080p.', '<h2><strong>Kiểu dáng nhỏ gọn, màu sắc tinh tế</strong></h2><p>Được thiết kế theo hướng đơn giản mà tiện lợi, rất phù hợp lắp đặt ở nhiều vị trí, camera ezviz c6n 2.0mp đang được xem là sản phẩm camera có giá tốt nhất trên thị trường hiện nay. Độ phân giải Full-HD 1080P mang đến cho người dùng những trải nghiệm hình ảnh sắc nét.</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-thiet-ke.jpg\" alt=\"thiết kế đẹp - ezviz c6n 1080p\"></p><h2><strong>Camera Ezviz C6N 2MP hỗ trợ xem toàn cảnh</strong></h2><p>Nhờ ống kính rộng có&nbsp;khả năng quay quét 355° lên xuống 55°, camera ezviz cs c6n có thể giúp bạn nắm bắt được mọi không gian trong ngôi nhà của mình. Chỉ một thao tác nhỏ trên ứng dụng EZVIZ trên điện thoại là bạn đã có thể quan sát mọi ngóc ngách mà không cần phải lắp đặt quá nhiều camera.</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-xoay-.jpg\" alt=\"xoay cho góc nhìn toàn cảnh - ezviz c6n 1080p\"></p><p>&nbsp;</p><blockquote><p>Bảng giá các&nbsp; mẫu <a href=\"https://digione.vn/camera-wifi-khong-day/\"><strong>Camera Wifi</strong></a><strong>&nbsp;</strong>được ưa chuộng nhất hiện nay</p></blockquote><h2><strong>Chế độ hồng ngoại thông minh</strong></h2><p>Camera C6N 2MP sử dụng cùng lúc 2 đèn hồng ngoại mạnh mẽ cùng với tính năng tự động điều chỉnh chế độ nhìn ban đêm, giúp bạn quan sát được hình ảnh vào ban đêm chi tiết hơn. Trong trường hợp ban đêm hay những môi trường yếu ánh sáng thì tầm nhìn của Ezviz CS C6N có thể lên đến 10 mét.</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-hong-ngoai.jpg\" alt=\"Quay ban đêm - \"></p><p>&nbsp;</p><h2><strong>Đàm thoại 2 chiều trên Ezviz C6N 1080P</strong></h2><p>Mặt sau C6N Ezviz được tích hợp loa và mic giúp việc trò chuyện trở nên dễ dàng hơn bao giờ hết.Nếu bạn đang không có ở nhà mà muốn trò chuyện cùng bố mẹ, con cái, thú cưng,..hay phát hiện những vị khách không mời đột nhiên vào nhà thì hãy yên tâm vì đã có C6N 2.0</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-dam-thoai.jpg\" alt=\"đàm thoại 2 chiều - ezviz c6n 1080p\"></p><p>&nbsp;</p><h2><strong>Camera C6N Ezviz - Lắp đặt mọi vị trí</strong></h2><p>Với thiết kế tiện lợi, bạn có thể lắp đặt camera Ezviz C6N 2MP tại bất kỳ vị trí nào trong ngôi nhà như để trên tủ, kệ, treo tường, gắn trần mà không hề làm mất đi vẻ đẹp vốn có của ngôi nhà.</p><p>Làm cách nào để quan sát được cả căn phòng mà vẫn mang lại được tính thẩm mỹ cao? Bạn cứ yên tâm nhé, đội ngũ kỹ thuật dồi dào kinh nghiệm tại&nbsp;<strong>DIGIONE</strong>&nbsp;sẽ tư vấn và hỗ trợ bạn chọn vị trí lắp đặt&nbsp;hiệu quả nhất có thể.</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-treo-tuong.jpg\" alt=\"thiết kế treo tường - ezviz c6n 1080p\"></p><p>&nbsp;</p><h2><strong>Camera C6N nhận diện chuyển động</strong></h2><p>Ngay khi phát hiện một vật thể chuyển động, camera thông minh C6N sẽ tự động theo dõi mọi hoạt động của chuyển động đó và ngay lập tức bạn cũng sẽ nhận được thông báo về điện thoại thông qua ứng dụng&nbsp; EZVIZ được cái đặt sẵn. Sẽ không có bất cứ hình ảnh bị bỏ sót nếu nằm trong tầm quan sát của camera. Sau khi đã phát hiện chuyển động, camera sẽ bật chế độ ghi hình chụp ảnh những chuyển động đó và ngay lập tức sẽ gửi về điện thoại thông qua ứng dụng&nbsp; EZVIZ được cái đặt sẵn. Bạn có thể nhanh chóng biết được điều gì đang xảy ra trong căn nhà cửa mình để kịp thời xử lý.</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-phat-hien-chuyen-dong.jpg\" alt=\"cám biến chuyển động thông minh - ezviz c6n 1080p\"></p><p>&nbsp;</p><h2><strong>Chế độ riêng tư có sẵn tại Camera C6N 1080P</strong></h2><p>Nếu khi bạn đã trở về nhà và không muốn những hoạt động riêng của mình bị ghi lại thì đã có chế độ riêng tư giúp bạn thoải mái hơn. Bạn chỉ cần vào Cài dặt trên ứng dụng EZVIZ trên điện thoại và đổi thành chế độ riêng tư là có thể làm bất cứ việc gì mình thích mà hông có cảm giác bị theo dõi.</p><p>&nbsp;</p><h2><strong>Hỗ trợ đọc thẻ nhớ Micro SD (Max 256GB)</strong></h2><p>Bạn có thể&nbsp;mua <a href=\"https://digione.vn/the-nho-va-chan-de/\">thẻ nhớ</a>, phù hợp với nhu cầu sử dụng:<br>&nbsp;- Thẻ nhớ 16Gb, thời gian lưu trữ 2-3 ngày<br>&nbsp;- Thẻ nhớ 32Gb, thời gian lưu trữ 4-5 ngày<br>&nbsp;- Thẻ nhớ 64Gb, thời gian lưu trữ 7-8 ngày<br>&nbsp;- Thẻ nhớ 128Gb, thời gian lưu trữ 15 ngày<br>&nbsp;- Thẻ nhớ 256Gb, thời gian lưu trữ 1 tháng</p><p>Với hệ thống ít camera và nhu cầu lưu trữ ngắn, thì việc lựa chọn lưu trữ thẻ nhớ là một lựa chọn phù hợp và tiết kiệm chi phí nhất. Bạn cũng có thể lưu trữ hình ảnh qua đám mây (có tính phí).</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-the-nho.jpg\" alt=\"Hỗ trợ thẻ nhớ dung lượng lớn - ezviz c6n 1080p\"></p><p>&nbsp;</p><h2><strong>Bộ Camera C6N 1080P bao gồm:</strong></h2><p>&nbsp;- 1 Camera C6N 2mp<br>&nbsp;- 1 Adapter sạc (5V)<br>&nbsp;- 1 Cáp sạc (độ dài 2m)<br>&nbsp;- 1 Đế gắn camera<br>&nbsp;- 1 Bộ ốc vít<br>&nbsp;- 1 Sổ hướng dẫn</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-phu-kien.jpg\" alt=\"phụ kiện kem theo - ezviz c6n 1080p\"></p><p>&nbsp;</p><h2><strong>Sử dụng cổng sạc micro USB phổ biến</strong></h2><p>Camera IP Wifi Ezviz C6N 1080P sử dụng cáp sạc Micro USB để cấp nguồn cho camera với độ dài 2m. Thiết bị có hai hình thức kết mạng là kết nối wifi và cổng mạng LAN, cho bạn thoải mái lắp đặt ở vị trí xa.</p><p><img src=\"https://digione.vn/upload/source/ezviz-c6n-smart-night-vision-1080/ezviz-c6n-cong-ket-noi.jpg\" alt=\"Cổng kết nối - ezviz c6n 1080p\"></p><p>&nbsp;</p>', 1000000, 0, 'Ezviz-C6N', 'Trong Kho', 0, 50, NULL, '1635660762.jpg', ',16356607620.jpg,16356607621.jpg', 11, '2021-10-30 23:12:42', '2021-10-30 23:12:42', NULL, NULL),
(55, ' Camera Ezviz C1C-B 1080p', 'camera-ezviz-c1c-b-1080p', 'Phù hợp lắp đặt TRONG NHÀ\nBản quốc tế xem từ xa không bị giới hạn\nGiám sát từ xa qua điện thoại.\nHình ảnh sắc nét Full HD - 1080p.', '<h2><strong>C1C B được thiết kế nhỏ gọn</strong></h2><p>Với thiết kế mới nhỏ gọn hiện đại, chân tích hợp nam châm giúp bạn dễ dàng tuỳ biến lắp đặt mà không cần khoan đục.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-c1c-b-1080p-h265-digione/camera-ip-wifi-ezviz-cs-c1c1-b-1080p-digione-thiet-ke.jpg\" alt=\"c1cb - thiết kế\"></p><p>&nbsp;</p><h2><strong>Ezviz C1C B - Đàm thoại 2 chiều</strong></h2><p>Được tích hợp loa và micro giúp bạn có thể đàm thoại từ xa qua điện thoại cho người thân, thú cưng trong nhà.</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-c1c-b-1080p-h265-digione/camera-ip-wifi-ezviz-cs-c1c1-b-1080p-digione-dam-thoai.jpg\" alt=\"ezviz c1c b - Đàm thoại 2 chiều\"></p><p>&nbsp;</p><h2><strong>C1C B 1080p - Hình ảnh sắc nét</strong></h2><p>Được trang bị ống kính thế hệ mới có độ phân giải cao Full HD giúp bạn xem video trực tiếp cũng như xem lại rõ ràng và sắc nét nhất có thể</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-c1c-b-1080p-h265-digione/camera-ip-wifi-ezviz-cs-c1c1-b-1080p-digione-hd.jpg\" alt=\"camera ezviz c1c b Độ phân giải Full HD\">&nbsp;</p><p>&nbsp;</p><h2><strong>Hỗ trợ quan sát ban đêm</strong></h2><p>Camera trong nhà được trang bị LED hồng ngoại tích hợp, tiên tiến đảm bảo phạm vi nhìn đêm Full-HD 12m (40ft). Bạn có thể quan sát được những hình ảnh thiếu ánh sáng giúp theo dõi được những hoạt động diễn ra xung quanh.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-c1c-b-1080p-h265-digione/camera-ip-wifi-ezviz-cs-c1c1-b-1080p-digione-hong-ngoai.jpg\" alt=\"camera c1c b\">&nbsp;</p><p>&nbsp;</p><h2><strong>Kiểu dáng dễ dàng lắp đặt</strong></h2><p>Đối với sản phẩm camera wifi C1C-B này, bạn có thể lựa chọn lắp đặt tại nhiều vị trí khác nhau trong nhà như đặt bàn, để tủ kệ, treo tường hay gắn trần sao cho phù hợp với nhu cầu theo dõi của mình.</p><p>&nbsp;</p><h2><strong>Camera Ezviz C1C-B Tích hợp cảm biến chuyển động</strong></h2><p>Bạn không cần phải quan sát điện thoại, máy tính 24/24 nữa mà hãy yên tâm với tính năng cảnh báo tự động của camera này. Bất kỳ hoạt động đáng ngờ nào được ghi lại trên camera sẽ tự động thông báo về điện thoại của bạn.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-c1c-b-1080p-h265-digione/camera-ip-wifi-ezviz-cs-c1c1-b-1080p-digione-chuyen-dong.jpg\" alt=\"ezviz c1cb - Phát hiện chuyển động\">&nbsp;</p><p>&nbsp;</p><p><strong>Ezviz C1C B Hỗ trợ đọc thẻ nhớ micro SD</strong></p><p>Bạn có thể&nbsp;mua&nbsp;<a href=\"https://digione.vn/the-nho-va-chan-de/\">thẻ nhớ</a>, phù hợp với nhu cầu sử dụng:<br>&nbsp;- Thẻ nhớ 16Gb, thời gian lưu trữ 2-3 ngày<br>&nbsp;- Thẻ nhớ 32Gb, thời gian lưu trữ 4-5 ngày<br>&nbsp;- Thẻ nhớ 64Gb, thời gian lưu trữ 7-8 ngày<br>&nbsp;- Thẻ nhớ 128Gb, thời gian lưu trữ 15 ngày<br>&nbsp;- Thẻ nhớ 256Gb, thời gian lưu trữ 1 tháng</p><p>Với hệ thống ít camera và nhu cầu lưu trữ ngắn, thì việc lựa chọn lưu trữ thẻ nhớ là một lựa chọn phù hợp và tiết kiệm chi phí nhất. Bạn cũng có thể lưu trữ hình ảnh qua đám mây (có tính phí).</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-c1c-b-1080p-h265-digione/camera-ip-wifi-ezviz-cs-c1c1-b-1080p-digione-the-nho.jpg\" alt=\"camera ezviz c1c-b Hỗ trợ thẻ nhớ\"></p><p>&nbsp;</p><h3><strong>Phần mềm bảo mật cao</strong></h3><p>Phần mềm camera cung cấp tùy chỉnh linh hoạt để bạn ghi hoặc không bất cứ khi nào bạn nghĩ là cần thiết. Chỉ bạn mới có chìa khóa để gải mã dữ liệu của mình trên Cloud.</p><p>&nbsp;</p><h2><strong>Bộ sản phẩm bao gồm :</strong></h2><p>&nbsp;- 1 camera C1C-B<br>&nbsp;- 1 adapter sạc (5V)<br>&nbsp;- 1 cáp sạc (độ dài 2m)<br>&nbsp;- 1 đế gắn camera<br>&nbsp;- 1 bộ ốc vít<br>&nbsp;- 1 sổ hướng dẫ sử dụng (có tiếng việt)</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-c1c-b-1080p-h265-digione/camera-ip-wifi-ezviz-cs-c1c1-b-1080p-digione-san-pham-2%20(1).jpg\" alt=\"camera ezviz c1c b Trọn bộ sản phẩm\"></p><p>&nbsp;</p>', 650000, 630000, 'Ezviz-C1C-B', 'Trong Kho', 0, 30, NULL, '1635660866.jpg', ',16356608660.jpg,16356608661.jpg', 11, '2021-10-30 23:14:26', '2021-10-30 23:14:26', NULL, NULL),
(56, ' Camera ip Wifi Ezviz C3WN CS-CV310 1080P (A0-1C2WFR, 2.8mm)', 'camera-ip-wifi-ezviz-c3wn-cs-cv310-1080p-a0-1c2wfr-28mm', 'Phù hợp lắp đặt NGOÀI TRỜI\nBản quốc tế xem từ xa không bị giới hạn\nChuẩn chống nước IP66\nGiám sát từ xa qua điện thoại.', '<h2><strong>Camera C3WN trang bị ang-ten kép</strong></h2><p>Camera Ezviz C3WN 1080P là sản phẩm camera ngoài trời&nbsp;&nbsp;được trang bị hệ thống ăng-ten kép, cho tín hiệu truyền xa ổn định, mạnh mẽ. Giúp kết nối xuyên qua những bức tường dày, chống nhiễu tín hiệu cực tốt.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-thiet-ke.jpg\" alt=\"Thiết kế 2 râu - ezviz c3wn\"></p><p>&nbsp;</p><h2><strong>Tích hợp micrô khử tiếng ồn</strong></h2><p>Camera Ezviz CV310 được tích hợp sẵn Micro ghi âm cùng công nghệ chống ồn cho phép bạn nghe được những gì đang diễn ra với âm thanh chất lượng cao. Người dùng sử dụng điện thoại thông minh để nghe mọi lúc mọi nơi.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-mich-thu-am.jpg\" alt=\"Tích hợp míc thu âm - ezviz c3wn\"></p><p>&nbsp;</p><h3><strong>Tầm nhìn ưu việt nhờ đèn LED hồng ngoại</strong></h3><p>Ezviz C3WN&nbsp;được trang bị tính năng thông minh như chống ngược sáng và bộ lọc hồng ngoại ICR mang đến khả năng quan sát tuyệt vời vào ban đêm trong phạm lên đến 30m. Ngoài ra, camera còn được trang bị đèn Led hồng ngoại công suất lớn cho camera, giúp quay rõ ràng các vật thể trong khung hình.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-hong-ngoai.jpg\" alt=\"Đèn hồng ngoại quay ban đêm - ezviz c3wn\"></p><p>&nbsp;</p><blockquote><p>Báo giá:Tất cả<a href=\"https://digione.vn/camera-wifi-khong-day/\"><strong> camera Wifi</strong></a> mới nhất đã có mặt ở Digione</p></blockquote><h2><strong>C3WN 1080P trang bị tính năng báo động thông minh</strong></h2><p>Khi phát hiện thấy chuyển động bất thường camera Ezviz CV310&nbsp;sẽ gửi video thông báo về điện thoại cho người dùng. Bên cạnh đó với chế độ riêng tư: cho phép bạn tắt ống kính của camera Ezviz 2.0&nbsp;về chế độ ngủ thông qua ứng dụng EZVIZ.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-bao-dong.jpg\" alt=\"Chức năng báo tin về điện thoại - ezviz c3wn\"></p><p>&nbsp;</p><h2><strong>Vững bền với thời tiết khắc nghiệt</strong></h2><p>Nhờ chất liệu vỏ được làm hoàn toàn bằng kim loại cùng chuẩn chống bụi và nước&nbsp;IP66. Nên camera Ezviz ngoài trời có độ bền cao và có khả năng bảo vệ bạn trước mọi loại hình thời tiết.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-chong-nuoc.jpg\" alt=\"IP66 chuẩn chống nước - ezviz c3wn\"></p><p>&nbsp;</p><h2><strong>Khe cắm thẻ nhớ Micro SD dung lượng lớn</strong></h2><p>Camera C3WN được trang bị một khe cắm thẻ nhớ microSD có dung lượng 256GB. Do đó, bạn có thể thoải mái lưu trữ các tập tin video không lo thiếu dung.&nbsp;Tất cả các tập tin này đều được bảo mật, chỉ bạn có thể xem được</p><p>Bạn có thể&nbsp;mua<a href=\"https://digione.vn/the-nho-va-chan-de/\"> thẻ nhớ</a>, phù hợp với nhu cầu sử dụng:<br>&nbsp;- Thẻ nhớ 16Gb, thời gian lưu trữ 2-3 ngày<br>&nbsp;- Thẻ nhớ 32Gb, thời gian lưu trữ 4-5 ngày<br>&nbsp;- Thẻ nhớ 64Gb, thời gian lưu trữ 7-8 ngày<br>&nbsp;- Thẻ nhớ 128Gb, thời gian lưu trữ 15 ngày<br>&nbsp;- Thẻ nhớ 256Gb, thời gian lưu trữ 1 tháng</p><p>Với hệ thống ít <a href=\"https://digione.vn/\">camera</a> và nhu cầu lưu trữ ngắn, thì việc lựa chọn lưu trữ thẻ nhớ là một lựa chọn phù hợp và tiết kiệm chi phí nhất. Bạn cũng có thể lưu trữ hình ảnh qua đám mây (có tính phí).</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-the-nho.jpg\" alt=\"Hỗ trợ ghi hình lên thẻ nhớ - ezviz c3wn\"></p><p>&nbsp;</p><h2><strong>Cổng kết nối đa dạng trên thiết bị</strong></h2><p>Camera Ezviz C3WN&nbsp;có hai hình thức kết nối mạng là kết nối wifi hoặc cổng lan với trường hợp camera lắp đặt quá xa và không thể kết nối wifi ổn định.&nbsp;</p><p>Sử dụng cổng ngồn 12V giúp camera hoạt động tốt mà vẫn tiết kiệm điện.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-cong-ket-noi.jpg\" alt=\"Hỗ trợ cổng mạng LAN - ezviz c3wn\"></p><p>&nbsp;</p><h3><strong>Kích thước thật của camera CS-CV310 (C3WN) 1080P</strong></h3><p>Camera Ezviz 2.0 mpx 1080P Full HD<strong>&nbsp;</strong>là sản phẩm camera wifi có kích thước khá nhỏ so với những sản phẩm canmera lắp đặt ngoài trời khác: 72mm x 72mm x 150 mm, khối lượng 288g.</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-kich-thuoc.jpg\" alt=\"Kích thước sản phẩm \"></p><p>&nbsp;</p><h2><strong>Bộ Camera C3WN 1080P gồm :</strong></h2><p>&nbsp;- 1 camera CS-CV310 (C3WN)<br>&nbsp;- 1 adapter sạc 12V ( dài tới 3m)<br>&nbsp;- 1 bộ ốc vít<br>&nbsp;- 1 sổ hướng dẫn (Có ngôn ngữ Tiếng Việt)<br>&nbsp;- 1 bộ bọc cổng nguồn và cổng LAN</p><p><img src=\"https://digione.vn/upload/source/camera-ip-wifi-ezviz-cs-cv310-c3wn-1080p-digione/ezviz-c3wn-cs-cv310-1080p-phu-kien.jpg\" alt=\"Phụ kiện chính hãng - ezviz c3wn\"></p><p>&nbsp;</p>', 1090000, 1050000, 'Ezviz-C3WN', 'Trong Kho', 0, 30, NULL, '1635660987.jpg', ',16356609870.jpg,16356609871.jpg', 11, '2021-10-30 23:16:27', '2021-10-30 23:16:27', NULL, NULL),
(57, ' Camera Kbone KN B21 1080P', 'camera-kbone-kn-b21-1080p', 'Phù hợp lắp đặt NGOÀI TRỜI...\nBản quốc tế xem từ xa không bị giới hạn\nChuẩn chống nước và bụi IP67\nGiám sát từ xa qua điện thoại.', '<h2><strong>Cấu tạo chắc chắn, hình ảnh sống động</strong></h2><p>Camera IP Wifi Kbone KN-B21 1080P được thiết kế với kiểu dáng hình trụ thon gọn nhưng không kém phần chắc chắn. Độ phân giải 2.0 Megapixel (Full-HD) và các tính năng chống ngược sáng DWDR, tự động cân bằng trắng (AWB), tự động bù sáng (AGC) cho hình ảnh đầu ra đẹp xuất sắc. Đây là một trong những sản phẩm giá rẻ&nbsp;mà chất lượng cực kỳ tốt trên thị trường hiện nay.</p><p><img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/thiet-ke-hinh-tru.jpg\" alt=\"\"></p><p>&nbsp;</p><h2><strong>Kbone KN-B21 quan sát không gian rộng</strong></h2><p>Với ống kính cố định 2.8mm cho góc nhìn 102°(H),46°(V), 108°(D), Camera Wifi KN-B21&nbsp;có thể bao quát hầu hết không gian xung quanh vị trí lắp đặt của camera. Đảm bảo độ an toàn tuyệt đối cho khu vực nhà bạn.</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/goc-nhin-rong.jpg\" alt=\"\"></p><p>&nbsp;</p><h2><strong>Camera tích hợp sẵn mic thu âm</strong></h2><p>Bề mặt camera được tích hợp sẵn Mic giúp bạn dễ dàng lắng nghe được âm thanh cuộc nói chuyện hay những sự việc xảy ra xung quanh khu vực lắp đặt ngay cả khi ở xa thông qua ứng dụng KBONE được cài đặt sẵn trên điện thoại.</p><p><img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/tich-hop-micro-thu-am.jpg\" alt=\"\"></p><p>&nbsp;</p><blockquote><p>Báo giá: Tổng hợp <a href=\"https://digione.vn/camera-wifi-khong-day/\"><strong>Camera Wifi</strong></a> chính hãng tốt nhất tại Digione</p></blockquote><h2><strong>Quan sát ban đêm hiệu quả</strong></h2><p>Kbvision Kn-B21 trang bị công nghệ hồng ngoại thông minh có tầm quan sát ban đêm lên đến 30m, cho phép bạn có thể xem được những hình ảnh rõ ràng ngay cả khi vào ban đêm hay trong điều kiện môi trường thiếu ánh sáng.</p><h3>&nbsp;<img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/hong-ngoai-xem-ban-dem.jpg\" alt=\"\"></h3><p>&nbsp;</p><h2><strong>Kbone-B21 hỗ trợ giám sát chuyển động</strong></h2><p>Camera Wifi KBone KN-B21 1080P hỗ trợ giám sát và phát hiện chuyển động, phát hiện con người để gửi cảnh báo về điện thoại của bạn thông qua ứng dụng cài đặt trên điện thoại.</p><p>Bạn có thể định vùng cấu hình, phạm vi để camera gửi cảnh báo tránh trường hợp cảnh báo sai đối tượng như con cái hay người thân.</p><p><img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/canh-bao-phat-hien-chuyen-dong.jpg\" alt=\"\">&nbsp;</p><p>&nbsp;</p><h2><strong>Chống chịu tốt với thời tiết xấu</strong></h2><p>Được thiết kế với vỏ ngoài chắc chắn kết hợp tiêu chuẩn chống nước và bụi IP67, KN-B21&nbsp;có thể hoạt động tốt ngoài trời dù mưa hay nắng và ngâm trong nước với độ sâu dưới 1m trong thời gian 30 phút.</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/lap-dat-duoc-ngoai-troi.jpg\" alt=\"\"></p><p>&nbsp;</p><h2><strong>KBone Kn-B21 cho phép thu phóng dễ dàng</strong></h2><p>Với khả năng phóng to hình ảnh lớn gấp 16 lần, bạn có thể phóng to hay thu nhỏ hình ảnh trên ứng dụng KBONE để việc quan sát trở nên dễ dàng hơn.</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/zoom-ky-thuat-so.jpg\" alt=\"\"></p><p>&nbsp;</p><h2><strong>Hoạt động ổn định dù ở xa</strong></h2><p>Ngoài ra, Camera còn được trang bị 2 ăng ten thu sóng Wifi, do đó bạn có thể lắp đặt ở ngay cả những vị trí xa cục phát mà không cần lo lắng về chất lượng hình ảnh bị gián đoạn.</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/thu-song-wifi.jpg\" alt=\"\"></p><p>&nbsp;</p><h2><strong>Hỗ trợ đọc thẻ nhớ dung lượng cao</strong></h2><p>Camera trang bị khe cắm thẻ nhớ Micro SD dung lượng lớn, tối đa lên đến 256GB. Tùy vào nhu cầu sử dụng và thời gian lưu trữ mà bạn có thể&nbsp;mua<a href=\"https://digione.vn/the-nho-va-chan-de/\"> thẻ nhớ</a>&nbsp;cho phù hợp:<br>&nbsp;- Thẻ nhớ 16Gb, thời gian lưu trữ 2-3 ngày<br>&nbsp;- Thẻ nhớ 32Gb, thời gian lưu trữ 4-5 ngày<br>&nbsp;- Thẻ nhớ 64Gb, thời gian lưu trữ 7-8 ngày<br>&nbsp;- Thẻ nhớ 128Gb, thời gian lưu trữ 15 ngày<br>&nbsp;- Thẻ nhớ 256Gb, thời gian lưu trữ 1 tháng</p><p>Với hệ thống ít <a href=\"https://digione.vn/\">camera</a> và nhu cầu lưu trữ ngắn, thì việc lựa chọn lưu trữ thẻ nhớ là một lựa chọn phù hợp và tiết kiệm chi phí nhất. Bạn cũng có thể lưu trữ hình ảnh qua đám mây (có tính phí).</p><p>&nbsp;<img src=\"https://digione.vn/upload/source/camera-wifi-kbone-kn-2011wn/ho-tro-the-nho.jpg\" alt=\"\"></p><p>&nbsp;</p><h2><strong>Phù hợp với mọi vị trí lắp đặt</strong></h2><p>Chiếm ưu thế từ sự gọn nhẹ, đi kèm là chân đế chắc chắn Camera IP Kbvision KBone Kn-B21&nbsp;rất thuận tiện cho việc chọn vị trí phù hợp mà vẫn giữ được mỹ quan của không gian lắp đặt. Bạn có thể lựa chọn lắp đặt đa dạng các vị trí như: cổng sau, cổng ngõ, cột điện, cột đèn,...</p>', 850000, 830000, 'Kbone-KN-B21', 'Trong Kho', 0, 20, NULL, '1635661089.jpg', ',16356610890.jpg,16356610891.jpg,16356610892.jpg', 11, '2021-10-30 23:18:09', '2021-10-30 23:18:09', NULL, NULL);
