(58, 'CPU Intel Core i7-10700K Avengers Edition', 'cpu-intel-core-i7-10700k-avengers-edition', 'CPU Intel Core i7-10700K Avengers Edition (3.8GHz turbo up to 5.1GHz, 8 nhân 16 luồng, 16MB Cache, 125W) - Socket Intel LGA 1200', '<h2>THÔNG SỐ KỸ THUẬT<br>&nbsp;</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td>Bộ vi xử lý (CPU)</td></tr><tr><td>Hãng sản xuất</td><td>Intel</td></tr><tr><td>Mã CPU</td><td>10700KA</td></tr><tr><td>Dòng CPU<br>&nbsp;</td><td>Core i7 Comet lake</td></tr><tr><td>Socket</td><td>LGA1200</td></tr><tr><td>Tốc độ</td><td>3.8Ghz</td></tr><tr><td>Tốc độ Tubor tối đa</td><td>Up to 5.1Ghz</td></tr><tr><td>Cache</td><td>16Mb</td></tr><tr><td>Nhân CPU</td><td>8 Core</td></tr><tr><td>Luồng CPU</td><td>16 Threads</td></tr><tr><td>VXL đồ họa</td><td>Intel® UHD Graphics 630</td></tr><tr><td>Dây chuyền công nghệ</td><td>14nm</td></tr><tr><td>Điện áp tiêu thụ tối đa</td><td>65W</td></tr><tr><td>Tính năng khác</td><td>Đang cập nhật</td></tr><tr><td>Kiểu đóng gói</td><td>Box</td></tr></tbody></table></figure>', 9700000, 9200000, 'CoreI7-Avengers-Edition', 'Trong Kho', 0, 20, NULL, '1635661193.jpg', ',16356611930.png,16356611931.png', 8, '2021-10-30 23:19:53', '2021-10-30 23:19:53', 4, NULL),
(59, 'RAM GSKill 8Gb DDR4-2400- F4-2400C17S-8GIS', 'ram-gskill-8gb-ddr4-2400-f4-2400c17s-8gis', 'RAM GSKill 8Gb DDR4-2400- F4-2400C17S-8GIS', '<h3>RAM GSKill 8Gb DDR4-2400- F4-2400C17S-8GIS<br>&nbsp;</h3><p><a href=\"https://www.phucanh.vn/bo-nho-trong-linh-kien-pc.html?brand=72\"><strong>RAM GSKill</strong></a><strong>&nbsp;8Gb DDR4-2400- F4-2400C17S-8GIS</strong>&nbsp;là sản phẩm&nbsp;<a href=\"https://www.phucanh.vn/bo-nho-trong-linh-kien-pc.html\"><strong>bộ nhớ trong&nbsp;</strong></a>đem lại giải pháp lý tưởng cho người dùng muốn xây dựng một máy tính chơi game mạnh mẽ.</p><p><img src=\"https://phucanhcdn.com/media/product/31980_ram_gsk_f4_2400c17s_8gis_a.jpg\" alt=\"\"></p><p><strong>Thiết kế cá tính bắt mắt, mạnh mẽ</strong></p><p><a href=\"https://www.phucanh.vn/bo-nho-trong-linh-kien-pc.html?brand=72\"><strong>Bộ nhớ trong&nbsp;GSKill</strong></a>&nbsp;được đặt tên theo chiếc khiên cứng cáp của các vị thần Hy Lạp -&nbsp;Aegis.&nbsp; Được hoàn thành với chất lượng cao nhất nhờ việc các IC được chọn kỹ càng và được thử nghiệm với quy trình xác nhận nghiêm ngặt của&nbsp;<strong>GSKILL</strong>&nbsp;trên tất cả các thương hiệu&nbsp;<a href=\"https://www.phucanh.vn/bo-mach-chu.html\"><strong>bo mạch chủ</strong></a>&nbsp;nổi tiếng và thông dụng, bộ nhớ RAM GSKILL được thiết kế đạt được sợ tương thích và ổn định nhất với các thiết bị cơ sở khác nhau.</p><p><strong>Hiệu năng mạnh mẽ</strong></p><p><strong>RAM GSKill&nbsp;DDR4&nbsp;Aegis</strong>&nbsp;là sự bổ sung mới trong hệ thống của&nbsp;<strong>GSKILL</strong>, được thiết kế để nâng cao hiệu năng đem lại sự ổn định cao cho mọi máy tính chơi game, cho dù là các tựa game FPS, MOBA hay&nbsp;MMORPG...nặng đều được vận hành trợ tru, mượt mà.&nbsp;</p><p>Được thiết kế với điện áp thấp 1.2V ở tiêu chuẩn DDR4, giảm 20% yêu cầu điện áp so với bộ nhớ DDR3. Giúp cho hệ thống máy tính của người dùng vận hành nhanh hơn, cùng với công nghệ tản nhiệt được dán trực tiếp lên&nbsp;<strong>RAM</strong>&nbsp;khi chơi game, hay thực hiện nhiều tác vụ một lúc mà không lo bị quá nhiệt.&nbsp;</p><p>Với tốc độ khởi đầu sẵn là DDR4 bus&nbsp;2400MHz giúp tăng hiệu quả hoạt động của hệ thống bằng cách tăng số lần truyền mỗi giây.</p><p><img src=\"https://phucanhcdn.com/media/product/31980_ram_gsk_f4_2400c17s_8gisb.jpg\" alt=\"\"></p><p>Bộ nhớ&nbsp;DDR4&nbsp;mới tương thích với bộ xử lý Intel Core thế hệ thứ 6 với công nghệ phần cứng tiên tiến để đảm bảo chơi game trơn tru cho các trò chơi mới nhất.&nbsp;</p><p>Sản phẩm hiện đang có bán tại&nbsp;<strong>Phúc Anh</strong>&nbsp;với chế độ bảo hành 36 tháng.</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td>Bộ nhớ trong PC</td></tr><tr><td>Hãng sản xuất</td><td>GSKill</td></tr><tr><td>Model</td><td>F4-2400C17S-8GIS</td></tr><tr><td>Loại RAM</td><td>DDR4</td></tr><tr><td>Dung lượng</td><td>8Gb</td></tr><tr><td>Bus</td><td>2400</td></tr><tr><td>Độ trễ</td><td>17-17-17-39</td></tr><tr><td>Điện áp</td><td>1.2V</td></tr><tr><td>Tản nhiệt</td><td>Dán</td></tr><tr><td>Công nghệ RAM</td><td>Non-ECC</td></tr></tbody></table></figure><p>&nbsp;</p>', 1190000, 0, 'GSkill-8gb', 'Trong Kho', 0, 50, NULL, '1635661268.jpg', ',16356612680.jpg', 8, '2021-10-30 23:21:08', '2021-10-30 23:21:08', 8, NULL),
(60, 'Ổ SSD Kingston SA400 240Gb SATA3', 'o-ssd-kingston-sa400-240gb-sata3', 'SSD Kingston SA400 240Gb SATA3 (đọc: 500MB/s /ghi: 350MB/s)', '<h2>Ổ SSD KINGTON SA400 240GB SATA3<br>&nbsp;</h2><p><a href=\"https://www.phucanh.vn/o-ssd-kingston-sa400-240gb-sata3-doc-500mbs-ghi-350mbs.html\"><strong>Ổ SSD KINGTON SA400 240GB SATA3</strong></a><strong>&nbsp;</strong>thể rắn với kích thước 2,5 inch chuẩn SATA3 được thiết kế để sử dụng cho máy tính để bàn và máy tính xách tay.</p><p>SA400 sẽ cải thiện đáng kể tốc độ máy tính của bạn. Bạn có một chiếc máy tính mới nhưng vẫn không hài lòng với tốc độ của ổ HDD và muốn tốc độ nhanh hơn nữa, hay máy tính của bạn đã cũ nhưng vẫn chưa có kinh phí để lên đời một chiếc máy mới. Với tốc độ cao lên tới 500MB/s (đọc) và 350MB/s (ghi), bạn sẽ có một chiếc máy tính khởi động trong chớp nhoáng, lưu trữ và truyền tải dữ liệu một cách đáng kinh ngạc, một chiếc máy cũ nhưng tốc độ khởi động nhanh hơn máy mới với ổ cứng cơ học bình thường, mang lại cho bạn một sự trải nghiệm về hiệu năng, sự đa nhiệm mượt mà, sẽ không còn tình trạng ngồi hàng phút đồng hồ đợi ổ load dữ liệu khi tốc độ của ổ SSD này đã nhanh hơn 10 lần so với ổ cứng truyền thống.<br>&nbsp;</p><p>Với 240Gb dung lượng, bạn sẽ không còn đắn đo khi nâng cấp vì nỗi lo không đủ dung lượng để lưu trữ, ngoài ra SA400 còn nhiều mức dung lượng cho các bạn muốn trải nghiệm tốc độ cao và lưu trữ dữ liệu ứng dụng thoải mái nhất.</p><p><img src=\"https://phucanhcdn.com/media/product/28093______ssd_kingston_sa400_240gb_sata3_hinh_1.jpg\" alt=\"\"></p><p><strong>Công nghệ</strong></p><p>SA400 với chuẩn giao tiếp SATA phiên bản 3.0 (6Bb/s) với khả năng tương thích ngược với SATA pheien bản trước 2.0 (3Gb/s).</p><p>Các mức dung lượng đa dạng: 120B, 240G, 480G, 960G… với bộ điều khiển 2ch và Nand: TLC dành cho cá nhân. Tuổi thọ trung bình lên tới 1 triệu giờ MTBF và bảo hành lên tới 3 năm sử dụng cùng với hỗ trợ kỹ thuật miễn phí.</p><p><strong>Thay thế ổ cứng</strong></p><p>Ổ cứng thể rắn đã và đang dần thay thế các ổ cứng truyền thống, không còn các bộ phận chuyển động tạo nên tiếng ồn và nguy cơ mất dữ liệu khi bad ổ do sử dụng lâu ngày. Ổ cứng thể rắn với các chíp nhớ sẽ truy xuất trực tiếp dữ liệu, cho tốc độ nhanh hơn và hoạt động êm ái hơn, ngoài ra nó cũng tạo nên sự an toàn khi di chuyển máy tính với công nghệ chống sốc ổ cứng, nhờ vậy tuổi thọ ổ cứng SSD sẽ cao hơn và độ tin cậy tốt hơn ổ cứng cơ truyền thống.</p><p><strong>Đối với máy tính để bàn và máy tính xách tay</strong></p><p>Với ổ cứng SSD cảu kington, tốc độ khởi động và tắt máy sẽ chỉ còn được tính bằng giây, các ứng dụng trong hệ thống máy tính sẽ được tải nhanh hơn, giúp bạn sao lưu hệ điều hành, sao lưu dữ liệu trong vài phút, tiết kiệm thời gian chờ.</p><p><strong>Kết luận</strong></p><p>Với SA400 bạn sẽ có 1 sự trải nghiệm tốc độ cao, thổi một sức sống mới cho hệ thống máy tính cũ, giúp bạn tiết kiệm chi phí mà vẫn cho sự trải nghiệm và độ tin cậy bằng cách hồi sinh hệ thống máy tính hiện tại của bạn.</p><h2>THÔNG SỐ KỸ THUẬT</h2><figure class=\"table\"><table><tbody><tr><td>Sản phẩm</td><td>Ổ SSD</td></tr><tr><td>Hãng sản xuất</td><td>Kingston</td></tr><tr><td>Model (P/N)</td><td>SA400</td></tr><tr><td>Loại ổ</td><td>SSD</td></tr><tr><td>Dung lượng</td><td>240Gb</td></tr><tr><td>Tốc độ đọc (SSD)</td><td>500MB/s</td></tr><tr><td>Tốc độ ghi (SSD)</td><td>350MB/s</td></tr><tr><td>Chuẩn giao tiếp</td><td>SATA3</td></tr><tr><td>Kích thước</td><td>2.5Inch</td></tr><tr><td>Tính năng khác</td><td>&nbsp;Ổ cứng SSD A400 của Kingston cải thiện đáng kể khả năng phản ứng của hệ thống hiện tại với thời gian khởi động, nạp và chuyển đổi đáng kinh ngạc so với các ổ cứng cơ học. Tốc độ nhanh hơn 10 lần so với ổ cứng truyền thống, cho hiệu năng cao hơn, đáp ứng đa nhiệm và hệ thống nhanh hơn.</td></tr></tbody></table></figure><p>&nbsp;</p>', 1500000, 1300000, 'SSD-Kingston-SA400', 'Trong Kho', 0, 20, NULL, '1635661370.jpg', ',16356613700.jpg,16356613701.jpg', 8, '2021-10-30 23:22:50', '2021-10-30 23:22:50', 7, NULL),
(61, 'Sofa G8217', 'sofa-g8217', 'Sofa để phòng khách trang trí', '<p>Màu sắc trang nhã lịch sự tạo cảm giác vui vẻ cho già đình</p>', 3500000, 3300000, 'Sofa-G8217', 'Trong Kho', 0, 20, NULL, '1635661617.jpg', NULL, 10, '2021-10-30 23:26:57', '2021-10-30 23:26:57', 9, NULL),
(62, 'Ban phim cơ E-DRA EK389v2', 'ban-phim-co-e-dra-ek389v2', 'Là bản nâng cấp LED từ đơn sắc lên Rainbow, E-DRA EK389 V2 sở hữu layout 89 phím độc đáo, nhỏ gọn như TKL nhưng lại có phím số phụ. ', '<p><strong>Thông số kỹ thuật</strong></p><figure class=\"table\"><table><tbody><tr><td><strong>Thương hiệu:</strong></td><td>E-DRA</td></tr><tr><td><strong>Model:</strong></td><td>EK389 v2</td></tr><tr><td><strong>Màu sắc:</strong></td><td>Đen</td></tr><tr><td><strong>Kết nối:</strong></td><td>Dây USB 2.0</td></tr><tr><td><strong>Loại bàn phím:</strong></td><td>89 phím</td></tr><tr><td><strong>Đèn LED:</strong></td><td>Rainbow</td></tr><tr><td><strong>Switch:</strong></td><td>Outemu: Blue/Brown/Red</td></tr><tr><td><strong>Keycap:</strong></td><td>ABS&nbsp;Double injection</td></tr><tr><td><strong>Độ dài dây cáp:</strong></td><td>1.6m bọc dù</td></tr><tr><td><strong>Tính năng:</strong></td><td>Antighosting</td></tr><tr><td><strong>Tương thích:</strong></td><td>Windows 98 / 2000 / ME / NT / XP / win 7,8,10</td></tr></tbody></table></figure><h3><strong>Đánh giá chi tiết bàn phím cơ E-Dra EK389 V2</strong></h3><p>&nbsp;</p><p>Là bản nâng cấp LED từ đơn sắc lên Rainbow, E-DRA EK389 V2 sở hữu layout 89 phím độc đáo, nhỏ gọn như TKL nhưng lại có phím số phụ. Layout khá “dị” 89 nút của E-Dra EK389 v2&nbsp;đã giải quyết được triệt để 2 vấn đề: Một chiếc bàn phím cơ gọn nhẹ nhưng vẫn đáp ứng tốt nhu cầu nhập liệu của dân văn phòng, trong khi không ảnh hưởng đến trải nghiệm gaming của anh em game thủ.</p><p><img src=\"https://file.hstatic.net/1000026716/file/ban-phim-co-e-dra-ek389-v2-1_7681d8b5f4a844c3bd7f53ef51c828d1.jpg\"></p><p>Bàn phím E-DRA EK389 V2 được nâng cấp từ phiên bản cũ với hệ thống LED 7 màu rainbow siêu sáng mới. Thực sự, LED của EK389 V2 cực sáng, sáng hơn cả EK387 hay các phiên bản phím cơ đắt tiền hơn của hãng. Đây có lẽ là phần nâng cấp thực sự đáng giá.</p><p><img src=\"https://file.hstatic.net/1000026716/file/ban-phim-co-e-dra-ek389-v2-2_f907b1d40a9f40a39923d5c948dad6cc.jpg\"></p><p>E-DRA EK389 V2 sử dụng switch Outemu (phiên bản không hotswap) với độ bền và độ ổn định cao. Switch Outemu cho chất lượng phím bấm tốt, tuy chưa được như Huano nhưng đổi lại chiếc bàn phím cơ này có mức giá tốt hơn.</p><p><img src=\"https://file.hstatic.net/1000026716/file/ban-phim-co-e-dra-ek389-v2-3_becbe1d652b74992ad806460256acfc7.jpg\"></p><p>Bàn phím E-DRA EK389 V2 không mang thiết kế phím mỏng và hiện đại hơn so với EK387, tuy nhiên phần plate được làm bằng kim loại nên nhìn chung EK389 V2 khá cứng cáp.</p><p><img src=\"https://file.hstatic.net/1000026716/file/ban-phim-co-e-dra-ek389-v2-4_bb47f6ac2d7647c78d74da2600e9a011.jpg\"></p><p>Nhìn chung, bàn phím E-DRA EK389 V2 là sự lựa chọn tốt cho những game thủ muốn mang đi mang lại chiếc bàn phím của mình khắp mọi nơi từ nhà tới quán net hay văn phòng làm việc. Nó có đủ các tính năng cần thiết, đi cùng điểm nhấn chính là sự gọn nhẹ nhưng vẫn tích hợp phần phím số. Tất nhiên để có được cụm số rất tiện lợi trong công việc này thì người dùng sẽ phải chịu khó sử dụng các nút chức năng như home, end, print screen… Một cách phiền hà hơn bằng cách bấm thêm nút FN. Lúc đầu sử dụng có vẻ hơi khó nhưng một thời gian sau sẽ quen dần.</p><p><img src=\"https://file.hstatic.net/1000026716/file/ban-phim-co-e-dra-ek389-v2-5_78b878079e9842d88e7bd3513562f113.jpg\"></p>', 800000, 799000, 'E-DRA EK389v2', 'Trong Kho', 0, 100, NULL, '1635744617.jpg', ',16357446170.jpg,16357446171.jpg,16357446172.jpg', 8, '2021-10-31 22:30:17', '2021-10-31 22:30:17', 12, 3);
